CREATE  PROCEDURE `mostrar_empresas` (IN `fe_nac` DATE, IN `anios` INT, IN `cant` INT)   BEGIN
	DECLARE ini INT;
	DECLARE fini DATE;
	DECLARE fini2 DATE;
	DECLARE final DATE;
	DECLARE fact INT;
	
	DECLARE aut DATE;
	DECLARE aut2 DATE;
	DECLARE fechsueldo INT;
	
	
	
	SET fini = DATE_ADD( fe_nac, INTERVAL 18 YEAR) ;
	SET fact = DAYOFWEEK(fini);
	

	IF fact = 7 THEN
	
		SET fini = DATE_ADD(fini, INTERVAL 2 DAY);
		SET final = DATE_ADD(fini, INTERVAL anios YEAR);
		
		SELECT sueldo_minimo INTO fechsueldo FROM sueldos WHERE final BETWEEN desde AND hasta LIMIT 1;
		
		
		SELECT id, empleador,fe_nac, fini, final  ,f_inic_act , f_baja_act
		  ,anios_transcurridos, fechsueldo
		FROM  vempresasanios
		WHERE f_inic_act < fini  AND f_baja_act > final AND anios_transcurridos >= 20
		ORDER BY rand()
		LIMIT cant;
		
		ELSEIF fact = 1 THEN
		
			SET fini = DATE_ADD(fini, INTERVAL 1 DAY);
			SET final = DATE_ADD(fini, INTERVAL anios YEAR);
			
			SELECT sueldo_minimo INTO fechsueldo FROM sueldos WHERE final BETWEEN desde AND hasta LIMIT 1;
			
			SELECT id, empleador,fe_nac, fini, final  ,f_inic_act , f_baja_act
			  ,  anios_transcurridos, fechsueldo
