			WHERE f_inic_act < fini  AND f_baja_act > final AND anios_transcurridos >= 20
			ORDER BY rand()
			LIMIT cant;
		
		ELSE 
		
			SET final = DATE_ADD(fini, INTERVAL anios YEAR);
			
			SELECT sueldo_minimo INTO fechsueldo FROM sueldos WHERE final BETWEEN desde AND hasta LIMIT 1;
		
			SELECT id, empleador,fe_nac,fini, final, f_inic_act , f_baja_act
