	END IF;
	
END$$

CREATE PROCEDURE `obtenerListadoEmpresas` (IN `dFechaIni` DATE, IN `dFechaFin` DATE, IN `tEmpresa` VARCHAR(50))   BEGIN

	DECLARE nAnios, nMeses, nDias int;
	DECLARE fechsueldo INT;
   DECLARE moneda_sueldo TEXT;
   DECLARE moneda_rm TEXT;
	DECLARE at_ss_1, at_fondo_juvi_1, at_pro_desocup_1, ap_ss_1, ap_fondo_juvi_1, ap_fonavi_1 DOUBLE;
	
	SELECT 
		CONCAT(unidad_moneda, ' ', sueldo_minimo) INTO moneda_sueldo
	FROM sueldos 
	WHERE dFechaFin BETWEEN desde AND hasta LIMIT 1;
    
     SELECT 
		unidad_moneda INTO moneda_rm
	FROM sueldos 
	WHERE dFechaFin BETWEEN desde AND hasta LIMIT 1;
	
	SELECT 
		sueldo_minimo INTO fechsueldo
	FROM sueldos 
	WHERE dFechaFin BETWEEN desde AND hasta LIMIT 1;
	
	SELECT 
			at_ss INTO at_ss_1
	FROM sueldos 
	WHERE dFechaFin BETWEEN desde AND hasta LIMIT 1;
	
	SELECT 
			at_fondo_juvi INTO at_fondo_juvi_1
	FROM sueldos 
	WHERE dFechaFin BETWEEN desde AND hasta LIMIT 1;
	
	SELECT 
			at_pro_desocup INTO at_pro_desocup_1
	FROM sueldos 
	WHERE dFechaFin BETWEEN desde AND hasta LIMIT 1;
	
	SELECT 
			 ap_ss INTO  ap_ss_1
	FROM sueldos 
	WHERE dFechaFin BETWEEN desde AND hasta LIMIT 1;
	
	SELECT 
		ap_fondo_juvi INTO ap_fondo_juvi_1
	FROM sueldos 
	WHERE dFechaFin BETWEEN desde AND hasta LIMIT 1;
	
	SELECT 
			ap_fonavi INTO ap_fonavi_1
	FROM sueldos 
	WHERE dFechaFin BETWEEN desde AND hasta LIMIT 1;

    
	SELECT
	(SELECT TIMESTAMPDIFF(YEAR,dFechaIni,dFechaFin))  AS ANIOS,
	(SELECT (TIMESTAMPDIFF(MONTH,dFechaIni,dFechaFin)) - (TIMESTAMPDIFF(YEAR,dFechaIni,dFechaFin) * 12)) AS MESES,
	(SELECT DATEDIFF(dFechaFin,DATE_ADD(DATE_ADD(dFechaIni, INTERVAL TIMESTAMPDIFF(YEAR,dFechaIni,dFechaFin) YEAR), INTERVAL (TIMESTAMPDIFF(MONTH,dFechaIni,dFechaFin)) - (TIMESTAMPDIFF(YEAR,dFechaIni,dFechaFin) * 12) MONTH))) AS DIAS
    INTO nAnios, nMeses, nDias;


	SELECT tipo_emp, ruc , empleador, nAnios AS Anios, nMeses AS Meses, nDias AS Dias ,fechsueldo, moneda_sueldo, moneda_rm, dpto, rep_legal , dni_a, at_ss_1, at_fondo_juvi_1, at_pro_desocup_1, ap_ss_1, ap_fondo_juvi_1, ap_fonavi_1, 	DATE_FORMAT(f_inic_act, "%d-%m-%Y") AS f_inic_act , DATE_FORMAT(f_baja_act, "%d-%m-%Y") AS f_baja_act
	FROM empresas
	WHERE f_inic_act <= dFechaIni AND f_baja_act >= dFechaFin AND tipo_emp = tEmpresa;
	
END$$

