CREATE  PROCEDURE `USP_RptListadoEmpresas` (IN `dFecha` DATE, IN `NroEmpresa` INT)   BEGIN
	DECLARE dFechaFiltro date;
    
	SELECT  DATE(DATE_ADD(dFecha, INTERVAL 18 YEAR)) INTO dFechaFiltro;

	SELECT ruc, empleador, f_inic_act FROM empresas
    WHERE f_inic_act >= dFechaFiltro
    LIMIT NroEmpresa;
    
    
END$$

